import './main.css';
import Footer from './components/footer/Footer';
import Header from './components/header/Header'
import ProfileBox from './components/user/profileBox/ProfileBox'


function App() {
  return (
    <div id='container'>
      <Header />
      <div id='content'>
        <ProfileBox />

      </div>
      <Footer />
    </div>
  );
}

export default App;
